import React from "react";
import Image from "../images/logo.png"
const ApplicationHeader=()=>
{
    return(<div><Header> <LeftSide>

        <div><img width={160} src={Image}></img></div>

    </LeftSide>
        <RightSide>
            <MainMenu role={rola} />
        </RightSide></Header></div>);
};
export default ApplicationHeader;
